import React from "react";

const Myheader = () => {
  return (
    <div className="container">
      <div className="row">
        <div class="col-4">
          <div className="card">
            <div>
              <ul class="list-group">
                <li class="list-group-item active">Profile Setting</li>
                <li class="list-group-item">Personal Details</li>
                <li class="list-group-item">Contact Details</li>
                <li class="list-group-item">Education Details</li>
                <li class="list-group-item">My Skills & Expeerience</li>
                <li class="list-group-item">My Resume</li>
              </ul>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Myheader;
